import React from 'react'

import DataTable from 'react-data-table-component';

const columns = [
        {
                name: 'Title',
                selector: row => row.title,
        },
        {
                name: 'Year',
                selector: row => row.year,
        },
];

const data = [
        {
                id: 1,
                title: 'Beetlejuice',
                year: '1988',
        },
        {
                id: 2,
                title: 'Ghostbusters',
                year: '1984',
        },
]


const Dashboard = () => {


        return (
                <div className="sec__one">
                         <DataTable
                        columns={columns}
                        data={data}
                />
                </div>
        )
}
export default Dashboard
